  false,\n\t\"url\": null,\n\t\"notes\": \"A polygon feature class of Miami-Dade County
  Fire Rescue (MDFR) Fire District Station Territories. The territories represent
  MDFR fire station jurisdiction or responsibility. Therefore, the five municipalities
  that have their own fire departments - Miami, Miami Beach, Coral Gables, Hialeah,
  and Key Biscayne - are excluded from the MDFR territories with the exception of
  the Port of Miami (station 39) which is in the City of Miami and the northeastern
  corner of Fisher Island (station 42) which is inside Miami Beach. Large areas of
  water and uninhabited islands, such as those of the Atlantic Ocean and Biscayne
  Bay, are also excluded from the MDFR territories, although this exclusion is currently
  considered inconsistent with the true definition of territory (meaning, jurisdiction/responsibility),
  since the MDFR Fire Boat at station 39 and many stations with rigid-hull inflatable
  boats (RHIBs) can and do respond in these unincorporated areas of water. It should
  also be noted that the FireDistrictStationTerritories are often, but not always,
  the same as the closest station areas (as depicted in CountywideClosestStationArea).
  As of this writing, stations 87 (administrative headquarters), 24 (Air Rescue),
  41, and 62 do not have territories because they either lack equipment or manpower.
  FireDistrictStationTerritory can be used for fire hydrant maintenance assignment.\",\n\t\"license_title\":
